import styled from 'styled-components';

export const Container = styled.p`
    display: flex;
    flex-wrap: wrap;
    align-content: flex-start;
    outline-style: solid;
`;

export const Label = styled.p`
    color: #000000;
    font-family: "poppins";
    font-size: 24px;
    outline-style: solid;
    width: 100%;
    height: 10px;
`;
export const Slider = styled.input`
    color: #000000;
    outline-style: solid;
    width: 100%;
`;

export const Result = styled.p`
    color: #F7B718;
    font-family: "poppins";
    font-size: 40px
`;
